:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  IWILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  IMACLEAN, Christopher Nelson and BAIRD, Jessie Elizabeth (Betty)
  IMACLEAN, Janet Beatrice and BISHOP, John Vincent
  Sa Wanganui.
  02> MACLEAN, Janet Beatrice m on 15.12.1965 to BISHOP, John Vincent
  b 19.02.1935
  b 11.04.1930
  Janet b. and m, at Wanganui. Vincent, s/o Frederic John Bishop and Mary
  Catherine Vincent, b. at Auckland. Address: 17 Parkes Avenue, St John's Hill,
  Wanganui.
  Janet was educated at Wanganui Girls' College (Prefect and Dux), Canterbury
  College (MA(Hons) in English) and Christchurch Teachers' College, She taught
  at Linwood High School, Christchurch (1958-60) then lived in the United
  Kingdom and Europe for two years, teaching English for some months at Pitman's College, London. On her
  return to New Zealand she joined the staff of Wanganui Girls' College. She returned to Wanganui Girls'
  College on a part-time basis in 1975-76, when her children were of school age.
  In 1986 Janet retrained as a SPELD teacher so that she could help children with specific learning
  disabilities on a one-to-one basis, and on many occasions she has been a reader/writer for candidates
  needing such assistance during examinations. Her other interests include such handcrafts as basketry,
  rugmaking and needlepoint and embroidery, and she has recently tried her hand at producing books
  suitable for young grandchildren. She and Vincent share an interest in reading, cryptic crosswords and
  travel and they are both members of the Historic Places Trust. Over recent years they have travelled
  extensively in Australia and the UK with shorter visits to North America, Asia and Continental Europe.
  They have a collection of prints, posters and books acquired on these travels.
  For many years Janet was directly involved with life at Wanganui Collegiate School as a Housemaster's
  wife. In fact her connection with the school covers over half a century (1935-90), first as the
  daughter of a Housemaster and Second Master and then as the wife of a Housemaster and Second Master,
  and also as a parent of a pupil. For 27 of these years she lived in school houses: Selwyn (1935-46),
  Marris (1966-78) and the Second Master's residence (1988-90).
  Vincent was brought up on a farm in the King Country and was educated at Tuhua Primary School then at
  King's College, Auckland, Auckland University College (BE(Hons), BSc) and Massey University (BA,
  DipsocSci(Dist)). He taught at King's College, Auckland, St Kentigern's College, Auckland, St Paul's
  Collegiate School, Hamilton then from 1962 to 1990 at Wanganui Collegiate School. There he was at
  various times, Head of Maths, Housemaster of Marris (1964-78), CO of the School Cadet Corps (attaining
  the rank of Major and being awarded the CFM), a rugby referee, in charge of outdoor education, and
  Second Master (1988-90). He was awarded an Honours Tie by Wanganui Collegiate School in 1990. His
  interests include building and computing, tramping and camping, and clocks and cats. His garden
  produces a variety of fresh fruit and vegetables to feed the family and friends all year round.
  01> BISHOP, Catherine Elizabeth m on 15.05.1993 to HOWLETT, Nigel John
  b 10.04.1967
  b 11.01.1962
  Catherine b. at Wanganui and m. at Goff's Oak, Herts, England. Nigel, slo Sidney and Kathleen
  Howlett, b. in England. Address: 5 Tixall Road, Hall Green, Birmingham B28 ORU, England.
  Catherine was educated at Wanganui High School (prefect and Dux), Victoria University, Wellington
  (BA in History and Mathematics, BA(Hons) in History) and Australian National University, Canberra
  (MA in History). She was both a Junior and Senior University Scholar and studied at Canberra on an
  ANU post-graduate scholarship. In 1983 she was a Rotary Exchange Student to Australia under the
  Twin-Exchange Scheme. She taught mathematics at Stowe School, UK in 1991-92 and she now works for
  Waterstone's Booksellers in Leamington Spa. Her interests include music, reading, gardening and
  travel.
  Nigel was educated at Newcastle University and is a chartered civil engineer working in the railway
  sector in Britain. His interests include DIY, cooking and football.
